 \uB9CE\uC740 \uBCC0\uC218\uAC00 \uC11C\uB85C \uC601\uD5A5\uC744 \uC8FC\uACE0 \uBC1B\uC73C\uBA70 \uBC1C\uC0DD\uD558\uB294 \uD604\uC0C1\uC774\uB77C, \uC608\uCE21 \uC790\uCCB4\uAC00 \uAD49\uC7A5\uD788 \uC5B4\uB835\uB2E4. \uC608\uCE21\uD55C\uB2E4\uB294 \uAC83 \uC790\uCCB4\uAC00 \uB610 \uB2E4\uC2DC \uBCF5\uC7A1\uACC4\uC5D0 \uC601\uD5A5\uC744 \uC918\uC11C \uACB0\uACFC\uB97C \uBC14\uAFBC\uB2E4. \uADF8\uB798\uC11C \uC608\uCE21\uD55C\uB2E4\uB294 \uAC83\uC774 \uC27D\uC9C0 \uC54A\uB2E4. \uADF8\uB807\uC9C0\uB9CC \uC791\uAC00\uB294 7\uAC00\uC9C0 \uC2DC\uADF8\uB110\uC744 \uD30C\uC545\uD558\uB77C\uACE0 \uD55C\uB2E4. \uADF8\uAC83\uC774 \uACFC\uAC70\uC758 \uC5ED\uC0AC \uC18D\uC5D0\uC11C \uBCFC \uB54C, \uD070 \uBCC0\uD654\uC758 \uC911\uC2EC\uC774 \uC77C\uC5B4\uB098\uAE30 \uC804\uC758 \uC2E0\uD638\uC600\uAE30 \uB54C\uBB38\uC774\uB2E4. \uAE08\uB9AC, \uBD80\uCC44, \uBC84\uBE14, \uD658\uC728, \uC911\uAD6D, \uC778\uAD6C, \uC3E0\uB9BC \uC2DC\uADF8\uB110\uC744 \uD30C\uC545\uD574\uB77C\uACE0 \uD55C\uB2E4. \uADF8\uB9AC\uACE0 \uB098\uC120, \uB2E4\uC2DC \uC774 \uC601\uD5A5\uB4E4\uC744 \uCC38\uACE0\uB9CC \uD558\uB77C\uACE0 \uD55C\uB2E4. \uC774\uAC83 \uC5ED\uC2DC \uACFC\uAC70\uC640 \uAC19\uC740 \uACB0\uACFC\uAC00 \uBC1C\uC0DD\uD558\uC9C0 \uC54A\uC744 \uC218 \uC788\uAE30 \uB54C\uBB38\uC774\uB2E4. "), mdx("p", null, "\uC704\uAE30 \uC18D\uC5D0\uC11C \uAE30\uD68C\uAC00 \uC0DD\uAE34\uB2E4. \uACBD\uC81C\uC5D0 \uB300\uD574 \uAD00\uC2EC\uC774 \uC5C6\uC5C8\uC9C0\uB9CC, \uC774 \uCC45\uC744 \uC77D\uACE0 \uACBD\uC81C\uC758 \uD750\uB984\uC774 \uAD81\uAE08\uD574\uC9C0\uAE30 \uC2DC\uC791\uD588\uB2E4. \uC870\uAE08 \uB72C\uAD6C\uB984 \uC7A1\uB294 \uBD84\uC57C\uB77C\uACE0 \uC0DD\uAC01\uD588\uC5C8\uB294\uB370, \uADF8\uB9AC\uACE0 \uB098\uC640\uB294 \uAD00\uACC4\uC5C6\uB294 \uBD84\uC57C\uB77C\uACE0 \uC0DD\uAC01\uD588\uC5C8\uB294\uB370, \uADF8\uB7F0 \uB2EB\uD78C \uC0AC\uACE0 \uBC29\uC2DD\uC744 \uC5EC\uB294\uB370 \uB3C4\uC6C0\uC774 \uB418\uC5C8\uB2E4. \uB2E4\uC2DC \uD55C\uBC88 \uC77D\uC5B4\uBCF4\uACE0 \uC9C0\uD6C8\uC7